import React from "react";


class NumberRow extends React.Component {
	constructor(props) {
		super(props);
	}
	
    render() {
        let html = [];

        for (let index = 1; index <= 18; index++) {
            let value;

            if (value < 10) {
                value = <div>{index}</div>;
            }
            else {
                value = <div>{index}</div>;
            }

            html.push(value);
        }

        return (
            <div className="numberRow">
                {html}
